public class StringUtils {
        public static String reverseString(String input) {
            if (input == null)
                return null;
            return new StringBuilder(input).reverse().toString();
        }

        public static boolean isPalindrome(String input) {
            if (input == null)
                return false;
            return input.equalsIgnoreCase(new StringBuilder(input).reverse().toString());
        }

        public static int countVowels(String input) {
            if (input == null)
                return 0;
            input = input.toLowerCase();
            int count = 0;
            for (int i = 0; i < input.length(); i++) {
                char ch = input.charAt(i);
                if (ch == 'a' || ch == 'e' || ch == 'i' || ch == 'o' || ch == 'u')
                    count++;
            }
            return count;
        }
    }

public class StringUtils {

        public static String reverseString(String input) {
            return (input == null)? null : new StringBuilder(input).reverse().toString();
        }

        public static boolean isPalindrome(String input) {
            return (input == null)? false : input.toLowerCase().equals(StringUtils.reverseString(input).toLowerCase());
        }

        public static int countVowels(String input) {
            return (input == null)? 0 : StringUtils.countVowels(input.toLowerCase());
        }

        public static int countVowels(String input, boolean ignoreCase) {
            input = input.toLowerCase();
            int count = 0;
            for (char c : input.toCharArray()) {
                switch (c) {
                    case 'a':
                    case 'e':
                    case 'i':
                    case 'o':
                    case 'u':
                        count++;
                        break;
                }
            }
            return count;
        }
    }

